import axios from "axios";
import React, { useEffect, useState } from "react";
import {
  GStockContainer,
  Wrapper,
  TableTh,
  GStockTable,
} from "./GstockElements.js";

const Gstock = () => {
  useEffect(() => {
    axios
      .get("https://productsapi1.herokuapp.com/api/produits")
      .then((Response) => {})
      .catch((error) => {});
  }, []);
  return (
    <div>
      <Wrapper>
        <GStockContainer>
          <GStockTable>
            <tr>
              <TableTh>Id</TableTh>
              <TableTh>Product</TableTh>
              <TableTh>image</TableTh>
              <TableTh>price</TableTh>
              <TableTh>hello</TableTh>
            </tr>
          </GStockTable>
        </GStockContainer>
      </Wrapper>
    </div>
  );
};

export default Gstock;
